-- ============================================
-- FAHRZEUGE
-- ============================================

CREATE TABLE vehicles (
    id INT AUTO_INCREMENT PRIMARY KEY,
    brand_id INT NOT NULL,
    name VARCHAR(150) NOT NULL,
    vehicle_type VARCHAR(50) NOT NULL,
    category ENUM('fahrzeuge', 'erntemaschinen', 'geraete', 'diverses') NOT NULL,
    price DECIMAL(12,2) NOT NULL,
    power_hp INT DEFAULT 0,
    max_speed INT DEFAULT 0,
    fuel_consumption DECIMAL(5,2) DEFAULT 0,
    maintenance_cost DECIMAL(10,2) DEFAULT 0,
    work_width DECIMAL(5,2) DEFAULT 0,
    capacity INT DEFAULT 0,
    required_level INT DEFAULT 1,
    image_url VARCHAR(255),
    description TEXT,
    is_active BOOLEAN DEFAULT TRUE,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    FOREIGN KEY (brand_id) REFERENCES vehicle_brands(id) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

-- ============================================
-- SPIELER-FAHRZEUGE (Besitz)
-- ============================================

CREATE TABLE farm_vehicles (
    id INT AUTO_INCREMENT PRIMARY KEY,
    farm_id INT NOT NULL,
    vehicle_id INT NOT NULL,
    custom_name VARCHAR(100),
    condition_percent INT DEFAULT 100,
    operating_hours INT DEFAULT 0,
    purchased_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
    last_maintenance TIMESTAMP NULL,
    is_for_sale BOOLEAN DEFAULT FALSE,
    sale_price DECIMAL(12,2) DEFAULT NULL,
    FOREIGN KEY (farm_id) REFERENCES farms(id) ON DELETE CASCADE,
    FOREIGN KEY (vehicle_id) REFERENCES vehicles(id) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

